css:
.editor {
  background-color: #000000;
  color: #cccccc;
}
.editor .bracket-matcher {
  background-color: rgba(0, 255, 255, 0.2);
  border: none;
  border-radius: 4px;
  box-shadow: 0 0 8px rgba(0, 255, 255, 0.4);
}
.editor .cursor {
  color: #00ffff;
}
.editor .gutter .line-numbers {
  color: rgba(255, 255, 255, 0.3);
}
.editor .gutter .line-numbers .cursor-line {
  background-color: rgba(255, 255, 255, 0.05);
  color: #40bfbf;
  text-shadow: 0 0 8px rgba(0, 255, 255, 0.8);
}
.editor .lines .class {
  color: #cc9633;
}
.editor .lines .comment {
  color: rgba(255, 255, 255, 0.3);
}
.editor .lines .constant {
  color: #965195;
}
.editor .lines .cursor-line {
  background-color: rgba(255, 255, 255, 0.05);
}
.editor .lines .entity {
  color: #cc9633;
}
.editor .lines .entity.name {
  color: #cccccc;
}
.editor .lines .function.name {
  color: #cccccc;
}
.editor .lines .indent-guide {
  color: rgba(255, 255, 255, 0.05);
}
.editor .lines .invisible-character {
  color: rgba(255, 255, 255, 0.3);
}
.editor .lines .keyword {
  color: #cc9633;
}
.editor .lines .keyword.operator {
  color: #cc9633;
}
.editor .lines .meta {
  color: #40bfbf;
}
.editor .lines .operator {
  color: #40bfbf;
}
.editor .lines .parameter.function {
  color: #cccccc;
}
.editor .lines .punctuation {
  color: #40bfbf;
}
.editor .lines .string {
  color: #965195;
}
.editor .lines .string .punctuation {
  color: #40bfbf;
}
.editor .lines .storage {
  color: #cc9633;
}
.editor .lines .support {
  color: #cccccc;
}
.editor .lines .variable {
  color: #965195;
}
.editor .lines .trailing-whitespace {
  background-color: rgba(255, 255, 255, 0.05);
}
.editor .lines .css .class {
  color: #cccccc;
}
.editor .lines .css .support,
.editor .lines .css .tag {
  color: #cc9633;
}
.editor .lines .html .tag {
  color: #cc9633;
}
.editor .lines .html .tag.punctuation {
  color: #40bfbf;
}
.editor .lines .html .tag .punctuation {
  color: #40bfbf;
}
.editor .selection .region {
  background-color: rgba(0, 255, 255, 0.2);
}
.editor .wrap-guide {
  background-color: rgba(255, 255, 255, 0.05);
}
